import React from "react";

const Navbar = () => {
  return (
    <div className="navbar-container">
      <div className="navbar-content">
        <div className="logo">
          <img src="../img/Pizza_logo.png" alt="logo" />
        </div>
      </div>
    </div>
  );
};

export default Navbar;
